import { Block } from "@material-ui/icons";
import "./Card.css";
function Card(props) {
  return (
    <div
      className="card"
      onAnimationStart={(style = { display: Block })}
      onAnimationEnd={(style = { display: none })}
    >
      {props.children}
    </div>
  );
}
export default Card;
